import React from "react";

const App = (props) =>{
        let a = <h1>you are maching</h1>
        let b = <h1>you are not maching</h1>

        let px = props.x;
        let py = props.y;
        let pz = props.z;

    return(
        <>
            <div className="machine">
                <h1>welcome to role machine</h1>
                <h1>{px} {py} {pz}</h1>
                {px===py && py===px ?a:b }
                
            </div>
        </>
    )
}
export default App;
